contracts/uintLibrary.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library uintLibrary {
        function getPrice() internal view returns (uint256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(
            0x694AA1769357215DE4FAC081bf1f309aDC325306
        );
        (, int256 answer, , , ) = priceFeed.latestRoundData();
        return uint256(answer*1e10);
    }

    function toUSD(uint256 ethAmount)
        internal
        view
        returns (uint256)
    {
        uint256 ethPrice = getPrice(); // 1 e 18
        uint amountInUSD = (ethPrice * ethAmount) / 1e18;
        return amountInUSD;
    }
}

contracts/myProfit.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

contract myProfit {

    address public immutable creatorContract;
    address immutable creator;

    constructor(address _creator) {
        creatorContract = msg.sender;
        creator = _creator;
    }

    function withdrawMyProfit() public onlyOwner payable {
        (bool callSuccess, ) = payable(msg.sender).call{
            value: address(this).balance
        }("");
        require(callSuccess, "Call Failed");
    }

    modifier onlyOwner() {
        require(msg.sender == creator, "Not Allowed! You are not the owner");
        _;
    }
}

